angular.module("KeepIt").provider("KeepItLocalStorageService",["KeepItProvider",function(a){return a.registerModule("KeepItLocalStorageService",a.types.PERSISTENT),{$get:function(){return function(a){return{cacheId:a,module:localStorage,computeKey:function(b){return"_KeepItModule_"+a+b},_put:function(a,b){localStorage.setItem(this.computeKey(a),JSON.stringify(b))},_get:function(a){return JSON.parse(localStorage.getItem(this.computeKey(a)))},_remove:function(a){localStorage.removeItem(this.computeKey(a))},_destroy:function(){angular.forEach(this.registeredKeys,function(a,b){localStorage.removeItem(this.computeKey(b))})}}}}}}]);